interface ToolbarProps {

}

const Toolbar: React.FC<ToolbarProps> = ({  }) => {
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
      </AppBar>
    </Box>
        </>
    );
};

export default Toolbar;
